import { useEffect, useState } from "react";
import { useDispatch } from "react-redux";
import { useHistory } from "react-router";

import { benefitApi, rewardApi } from "@api";
import { ComponentRewardList } from "@components";
import { IReward, IDataReward } from "@interfaces";
import { setLoading } from "@redux";
import { REWARD } from "@configs";
import { IBenefit } from "src/Interfaces/benefit";

export const ModulesBenefit = () => {
    const dispatch = useDispatch();
    const history = useHistory();
    //page state
    const [benefit, setBenefit] = useState<IBenefit[]>([]);

    useEffect(() => {
        (async () => {
            dispatch(setLoading(true));
            const res = await benefitApi.getListBenefit();
            const data = res.data.docs as IBenefit[];
            console.log(data);
            setBenefit(data);
            dispatch(setLoading(false));
        })();
    }, []);

    const handleClick = (value: IReward) => {
        if (value.levelIds?.length) return;
        history.push(REWARD + "/" + value._id);
        //
    };

    return <></>;
};
